def row(n):
    b = bin(n)[2:]
    s1 = set(b[:i+1] + "0" + b[i+1:] for i in range(len(b)) if b[i] == "1")
    s2 = set(b[:i] + b[i+1:] for i in range(len(b)) if b[i] == "0")
    return sorted(int(w, 2) for w in s1 | s2)
